import React from "react";
import AdminDashboard from ".";
import "react-quill/dist/quill.snow.css";
import ReactQuill from "react-quill";
import { Card, CardBody, Form, FormInput, Button, FormSelect } from "shards-react";

function EditWebsite() {
  return (
    <div>
      <AdminDashboard/>
      <div>.</div>
      <Card small className="addForm">
      <div className="form-title">EDIT THE WEBSITE BELOW</div>

        <CardBody>
          <Form className="add-new-post">
            {/* <FormInput
              size="lg"
              className="mb-3"
              placeholder="Your Post Title"
            /> */}
            <FormSelect size="lg"
              className="mb-3"
              placeholder="Select Edit Name">
                <option>Homepage Circle Content</option>
                <option>Our Services - First Card - Title</option>
                <option>Our Services - First Card - Description</option>

            </FormSelect>
            <ReactQuill className="add-new-post__editor mb-1" />
          </Form>
        </CardBody>
        <div className="publish"><button className="publish-btn">Publish</button></div>

      </Card>
    </div>
  );
}

export default EditWebsite;
